{
  "translationLines": [
    {
      "lineNumber": 21941,
      "originalJapaneseLine": "　創造神ルドラサウムに仕える、上位の神です」",
      "translatedEnglishLine": "\"I am a higher-ranking god serving the Creator God Rudrasaum.\""
    },
    {
      "lineNumber": 21942,
      "originalJapaneseLine": "コーラの背中から、光輝く翼が広がった。",
      "translatedEnglishLine": "Radiant wings spread out from Cola's back."
    },
    {
      "lineNumber": 21943,
      "originalJapaneseLine": "「その、姿…………天使……？」",
      "translatedEnglishLine": "\"That form... an angel...?\""
    },
    {
      "lineNumber": 21944,
      "originalJapaneseLine": "「はい。……私の素性とか、",
      "translatedEnglishLine": "\"Yes... As for my true identity,"
    },
    {
      "lineNumber": 21945,
      "originalJapaneseLine": "　ほとんど気にもしませんでしたよね。",
      "translatedEnglishLine": "you hardly seemed to care at all, right?"
    },
    {
      "lineNumber": 21946,
      "originalJapaneseLine": "　まったく、少しは疑えばいいものを……」",
      "translatedEnglishLine": "Honestly, you should have doubted just a little..."
    },
    {
      "lineNumber": 21947,
      "originalJapaneseLine": "「じゃあ、本当に……",
      "translatedEnglishLine": "\"Then, really..."
    },
    {
      "lineNumber": 21948,
      "originalJapaneseLine": "　神……神が、魔王を作るのか！？」",
      "translatedEnglishLine": "God... gods create the Demon Lord?!\""
    },
    {
      "lineNumber": 21949,
      "originalJapaneseLine": "「えぇ。ま、そうですよ。",
      "translatedEnglishLine": "\"Yes. Well, that's right."
    },
    {
      "lineNumber": 21950,
      "originalJapaneseLine": "　それを言うなら勇者を作ったのもあの神-ﾋﾄ-です",
      "translatedEnglishLine": "If you say that, that same god also created the Hero— the human."
    },
    {
      "lineNumber": 21951,
      "originalJapaneseLine": "「………………！」",
      "translatedEnglishLine": "\"............!\""
    },
    {
      "lineNumber": 21952,
      "originalJapaneseLine": "「……貴方は、乗せられたんです。",
      "translatedEnglishLine": "\"...You were manipulated."
    },
    {
      "lineNumber": 21953,
      "originalJapaneseLine": "　神の作った、勇者というシステムに」",
      "translatedEnglishLine": "By the system called 'Hero' created by the gods.\""
    },
    {
      "lineNumber": 21954,
      "originalJapaneseLine": "「おや人聞きの悪い。",
      "translatedEnglishLine": "\"Oh, that sounds harsh."
    },
    {
      "lineNumber": 21955,
      "originalJapaneseLine": "　アリオスの意思を尊重したんですけどね」",
      "translatedEnglishLine": "I was just respecting Arios's will, you see.\""
    },
    {
      "lineNumber": 21956,
      "originalJapaneseLine": "「そんな、馬鹿なッ…………！",
      "translatedEnglishLine": "\"That can't be...!\""
    },
    {
      "lineNumber": 21957,
      "originalJapaneseLine": "　何がしたいんだ！　どうして、こんな……！」",
      "translatedEnglishLine": "What do you want?! Why do this...!\""
    },
    {
      "lineNumber": 21958,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": "\"..............\""
    },
    {
      "lineNumber": 21959,
      "originalJapaneseLine": "「暇つぶしですよ」",
      "translatedEnglishLine": "\"It's just killing time.\""
    },
    {
      "lineNumber": 21960,
      "originalJapaneseLine": "「何…………？」",
      "translatedEnglishLine": "\"What...?\""
    },
    {
      "lineNumber": 21961,
      "originalJapaneseLine": "「ルドラサウム様は、する事がなくてヒマなんです。",
      "translatedEnglishLine": "\"Lord Rudrasaum has nothing to do and is bored."
    },
    {
      "lineNumber": 21962,
      "originalJapaneseLine": "　この地上の生物の営みを",
      "translatedEnglishLine": "Watching the activities of creatures on this earth"
    },
    {
      "lineNumber": 21963,
      "originalJapaneseLine": "　眺めて過ごすくらいしかすることないんで」",
      "translatedEnglishLine": "is about all there is to do.\""
    },
    {
      "lineNumber": 21964,
      "originalJapaneseLine": "「その無聊を慰める為、スリリングな展開を作るのが",
      "translatedEnglishLine": "\"To alleviate that boredom, it's our job as gods"
    },
    {
      "lineNumber": 21965,
      "originalJapaneseLine": "　私たち、神の仕事でしてね」",
      "translatedEnglishLine": "to create thrilling developments like these.\""
    },
    {
      "lineNumber": 21966,
      "originalJapaneseLine": "「それが、勇者と……魔王だ、っていうのか……？",
      "translatedEnglishLine": "\"You mean, that's what the Hero and... the Demon Lord are...?"
    },
    {
      "lineNumber": 21967,
      "originalJapaneseLine": "　そんな、そんなもの、が……」",
      "translatedEnglishLine": "Something like that...\""
    },
    {
      "lineNumber": 21968,
      "originalJapaneseLine": "「はい。正確には、その仕事のひとつ、ですけどね。",
      "translatedEnglishLine": "\"Yes. To be precise, it's one of our tasks."
    },
    {
      "lineNumber": 21969,
      "originalJapaneseLine": "　今回は評判いいですよ。",
      "translatedEnglishLine": "This time, it's gotten quite a good reputation."
    },
    {
      "lineNumber": 21970,
      "originalJapaneseLine": "　そりゃーもう、どこもかしこも阿鼻叫喚ですし」",
      "translatedEnglishLine": "Everywhere is filled with screams and chaos, after all.\""
    },
    {
      "lineNumber": 21971,
      "originalJapaneseLine": "「せ、世界は……平和に、ならないのか……？」",
      "translatedEnglishLine": "\"W-will the world... never be at peace...?\""
    },
    {
      "lineNumber": 21972,
      "originalJapaneseLine": "「なりませんよ。神の思し召しどおりに、ね」",
      "translatedEnglishLine": "\"It will not. Just as the gods have ordained.\""
    },
    {
      "lineNumber": 21973,
      "originalJapaneseLine": "「………………！」",
      "translatedEnglishLine": "\"............!\""
    },
    {
      "lineNumber": 21974,
      "originalJapaneseLine": "がくりと、アリオスの膝が折れる。",
      "translatedEnglishLine": "Arios's knees suddenly gave out."
    },
    {
      "lineNumber": 21975,
      "originalJapaneseLine": "「っ……けど、魔王なら、倒せるんだ……",
      "translatedEnglishLine": "\"B-but, if it's the Demon Lord, we can defeat him..."
    },
    {
      "lineNumber": 21976,
      "originalJapaneseLine": "　こうなれば、何度でも…………！」",
      "translatedEnglishLine": "Now, we can do it over and over again...!\""
    },
    {
      "lineNumber": 21977,
      "originalJapaneseLine": "「ま、そうですね。",
      "translatedEnglishLine": "\"Well, yes."
    },
    {
      "lineNumber": 21978,
      "originalJapaneseLine": "　実は、もっと徹底的に生き物が死ねば、",
      "translatedEnglishLine": "Actually, if more creatures died thoroughly,"
    },
    {
      "lineNumber": 21979,
      "originalJapaneseLine": "　エスクードソードなら…………あ」",
      "translatedEnglishLine": "the Escudo Sword could... ah."
    },
    {
      "lineNumber": 21980,
      "originalJapaneseLine": "「………………？」",
      "translatedEnglishLine": "\"............?\""
    },
    {
      "lineNumber": 21981,
      "originalJapaneseLine": "「時間切れ、ですね」",
      "translatedEnglishLine": "\"Time's up, isn't it.\""
    },
    {
      "lineNumber": 21982,
      "originalJapaneseLine": "「えっ、あ……あ、あぁっ…………！？」",
      "translatedEnglishLine": "\"Eh, ah... a-ahh...!?\""
    },
    {
      "lineNumber": 21983,
      "originalJapaneseLine": "剣が、重い。その重さに耐えかねて、手から落ちる。",
      "translatedEnglishLine": "The sword was heavy. Unable to bear the weight, it slipped from his hand."
    },
    {
      "lineNumber": 21984,
      "originalJapaneseLine": "「こ、っ……これ、はっ…………！」",
      "translatedEnglishLine": "\"Th-this... this is...!\""
    },
    {
      "lineNumber": 21985,
      "originalJapaneseLine": "「セラクロラスの力も、永続はしませんからね。",
      "translatedEnglishLine": "\"Even the power of Seracloras does not last forever."
    },
    {
      "lineNumber": 21986,
      "originalJapaneseLine": "　……もう、勇者はいない。また探さないと」",
      "translatedEnglishLine": "There's no hero left now. We'll have to search for another.\""
    },
    {
      "lineNumber": 21987,
      "originalJapaneseLine": "「………………！」",
      "translatedEnglishLine": "\"............!\""
    },
    {
      "lineNumber": 21988,
      "originalJapaneseLine": "ひょいと、そのエスクードソードを",
      "translatedEnglishLine": "With a light motion, the Escudo Sword was"
    },
    {
      "lineNumber": 21989,
      "originalJapaneseLine": "天使の手が拾い上げる。",
      "translatedEnglishLine": "picked up by the angel’s hand."
    },
    {
      "lineNumber": 21990,
      "originalJapaneseLine": "（勇者なら、三超神を殺す方法もあったんですけど。",
      "translatedEnglishLine": "(If I were the Hero, there was even a way to kill the Three Supreme Gods.)"
    }
  ]
}

